"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Dysarthria (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/dysarthria-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H6590949\">",
"      <span class=\"h1\">",
"       What is dysarthria?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Dysarthria is the term doctors use when a person loses the ability to control his or her mouth and throat to form speech. It can happen along with another disorder called aphasia, which impairs a person&rsquo;s ability to understand language. People who have only dysarthria can understand language; they just can&rsquo;t form words clearly.",
"     </p>",
"     <p>",
"      People with dysarthria might:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Slur their speech and sound as though they are drunk",
"       </li>",
"       <li>",
"        Speak very softly or in a whisper",
"       </li>",
"       <li>",
"        Speak too quickly or too slowly, or mumble",
"       </li>",
"       <li>",
"        Sound hoarse, nasal, or breathy when they talk",
"       </li>",
"       <li>",
"        Drool or have trouble controlling their saliva",
"       </li>",
"       <li>",
"        Have trouble chewing or swallowing",
"       </li>",
"       <li>",
"        Find that their face droops to 1 side",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H6590964\">",
"      <span class=\"h1\">",
"       What causes dysarthria?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Dysarthria is usually caused by a disease or an injury that damages the brain or the body&rsquo;s nerves or muscles. For example, dysarthria can happen because of these conditions:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Stroke",
"       </li>",
"       <li>",
"        Parkinson disease",
"       </li>",
"       <li>",
"        Amyotrophic lateral sclerosis, also known as &ldquo;ALS&rdquo; or Lou Gehrig's disease",
"       </li>",
"       <li>",
"        Multiple sclerosis (sometimes called &ldquo;MS&rdquo;)",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Some medicines, including medicines that make people sleepy, can also cause dysarthria.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H6590979\">",
"      <span class=\"h1\">",
"       Will I need tests?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Maybe. If you develop a new problem with speaking, your doctor or nurse will want to do an exam and learn about your problem. He or she will want to know what medicines you take and what else was happening when your problem started.",
"     </p>",
"     <p>",
"      It&rsquo;s also possible you will need 1 or more of these tests:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        MRI or CT scan &ndash; These are imaging tests that create pictures of the inside of the body. Doctors can use them to check for problems in the brain or in the nerves and muscles that control speech.",
"       </li>",
"       <li>",
"        Electromyography (also called &ldquo;EMG&rdquo;) or nerve conduction studies (also called &ldquo;NCS&rdquo;) &ndash; These tests check how well nerves and muscles are working.",
"       </li>",
"       <li>",
"        Blood and urine tests",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H6590994\">",
"      <span class=\"h1\">",
"       Will I regain my ability to speak?",
"      </span>",
"      &nbsp;&mdash;&nbsp;That depends on the cause of your dysarthria. If your dysarthria was caused by a stroke, you might be able to speak normally again one day. But if your dysarthria was caused by a nerve or muscle disorder that gets worse over time, it is less likely you will be able to speak normally again. Still, people with dysarthria can often learn new ways to communicate. For instance, they can learn to use alphabet boards to spell out the words they want to say. Plus, new technologies are being developed that use computers to help people speak.",
"     </p>",
"     <p>",
"      If you develop dysarthria, you will probably need to work with a speech and language therapist. He or she can give you exercises to do to improve the way you speak. If you have problems swallowing, the therapist can also help you learn about things that can improve your swallowing. For instance, he or she might recommend that you eat and drink only things that are thick and have few chunks. That way you are less likely to choke or have foods go down the wrong way.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H6591009\">",
