var title_f26_23_27005="ST segment resolution outcome";
var content_f26_23_27005=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F53047&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F53047&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 492px\">",
"   <div class=\"ttl\">",
"    Rapid ST segment resolution after thrombolysis is associated with a better outcome",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 472px; height: 248px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    After a two-year follow-up, patients with rapid ST segment resolution after thrombolysis had a higher incidence of reinfarction (27 versus 9 percent), but a lower incidence of heart failure, mortality, and mortality and/or HF (3 versus 22 percent) compared to those without rapid ST segment resolution.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from: Matetzky S, Freimark D, Chouraqui P, et al. J Am Coll Cardiol 1998; 32:1326.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
