" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Asymmetric hypertrophy in hypertrophic cardiomyopathy",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 209px; height: 236px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The parasternal long axis view from a two dimensional echocardiogram in a patient with hypertrophic cardiomyopathy shows asymmetric septal hypertrophy (ASH), with typical thickened septum relative to the posterior wall, and systolic anterior motion (SAM) of the mitral valve. As a result of SAM, the left ventricular outflow tract is almost completely obliterated.",
